import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'zcar';

  openRegister(){
    const modal = document.getElementById('registermodal');
    if(modal != null){
      modal.style.display = 'block'
    }
  }
}
